import React from 'react';
import './HomePage.css';
import FishingSpotList from '../components/FishingSpotList';
import { useHistory } from 'react-router-dom';
import { useJsApiLoader } from '@react-google-maps/api';
import { signOut } from "firebase/auth";
import { auth } from '../firebase';

const HomePage = () => {
    const history = useHistory();
    const { isLoaded } = useJsApiLoader({
        googleMapsApiKey: "AIzaSyAgtx6yT4yO1KxGO1qRIDAbi2saRZYjwJ8",
        libraries: ['places'] // <-- Add this line!
    });

    const handleLogout = async () => {
        await signOut(auth);
        history.push('/login');
    };

    return (
        <div className="home-page">
            <div className="logout-btn-wrap">
                <button className="logout-btn" onClick={handleLogout}>
                    Logout
                </button>
            </div>
            <FishingSpotList isLoaded={isLoaded} />
        </div>
    );
};

export default HomePage;
